import './App.css';
import Topbar from './components/topbar';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
      <Topbar/>
      <Routes>
        <Route path="/" exact element={<Home />}/> 
      </Routes>
      </Router>


    </div>
  );
}

export default App;
